import React, { Component } from 'react';

class Banner  extends Component {
    constructor(){
        super()
        this.state ={
            fetchedData : {}
        }

    }
    componentDidMount(){
        fetch("https://jsonplaceholder.typicode.com/posts/1")
        .then(res => res.json())
        .then(data =>{
            this.setState({
                fetchedData : data
            })
        })
    }
    render() { 
        return ( 
            <div>
                {history.state.fetchedData.title}
            </div>
         );
    }
}
 
export default Banner;
